INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Kayaking for Clean Up Australia Day', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174701482', 'Sinbad Street Boat Ramp', '2025-03-02T10:00:00+11:00', '2025-03-02T13:00:00+11:00', 'Sunday, 2 March 2025, 9am - 12pm', 'Bookings essential. Join staff from Boondall Wetlands Environment Centre and Paddle Queensland on a kayak adventure to help clean up our creeks and preserve coastal biodiversity. All equipment and instruction is provided, perfect for beginners or those with experience. Paddling is a low impact activity, but due to the nature of paddlesports a reasonable level of fitness and health is required to participate.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, '$6', 'https://www.trumba.com/i/DgBzdS6bCYEbE5Phd4vHnaiL.jpeg', '10 years and over. Each person under 16 years must be accompanied by an adult.', 'Bookings essential. To book visit <a href="http://paddleqld.asn.au/event-calendar/" target="_blank">Paddle Queensland</a>. For more information phone Paddle Queensland on 0414 960 728.', NULL, 'Kids,Teens,Young adults,Adults (30+)', 'Sinbad Street Boat Ramp', 'Sinbad Street Boat Ramp, Sinbad Street, Shorncliffe', 'Park', '.', 'Adventure,Water activities', 'Clothing and enclosed shoes that can get wet (not Crocs or any footwear that can fall off), towel and change of clothes.', 'By the Shorncliffe public boat ramp off Sinbad Street.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174701482');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Understory by Rachel Apelt', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d181110489', 'Boondall Wetlands Environment Centre', '2025-03-02T10:00:00+11:00', '2025-03-02T17:00:00+11:00', 'Sunday, 2 March 2025, 9am - 4pm', 'Be drawn into a dialogue with nature through Rachel Apelt’s Understory.

Visual artist Rachel Apelt, who lives in the upper catchment of Kedron Brook and Cabbage Tree Creek, shares her deep connection to nature with this exhibition. A ‘walking artist,’ her work presents details and impressions from her daily walks along creeklines and forest reserves. The work celebrates the special role of Macaranga trees in creekline regeneration, highlighting their beauty and ecological importance as well as the sense of community that can flourish in their shade.

Understory is open now until 30 May 2025 at the Boondall Wetland Environment Centre.

Open hours:
Tuesday - Friday 9am - 4pm
Saturday - Sunday 9am - 12pm', 'Brisbane City Council', 'Art,Exhibitions', NULL, 'Art', 'Free', 'https://www.trumba.com/i/DgBcNONfJR-%2A3%2AhTaNLWTVmA.jpg', 'All ages', 'No bookings required.', TRUE, NULL, 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '181110489');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Growing organic veggies for a year round supply', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d173994348', 'Cox Park, Lota', '2025-03-02T10:30:00+11:00', '2025-03-02T12:30:00+11:00', 'Sunday, 2 March 2025, 9:30 - 11:30am', 'Bookings essential. We have the opportunity to grow food all year round. Topics will include our South East Queensland seasons, plant choices and how to plan for a harvest throughout the year.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgDwk7iSy2aP5sP57igwxDZp.jpg', 'All ages', 'Bookings essential. To book text Jenny from Bethania Street Community Garden on 0439 048 585.', NULL, NULL, 'Cox Park, Lota', 'Cox Park, 64 Richard Street, Lota', 'Park', '.', 'Gardening and environment', NULL, 'At the garden shelter in the community garden.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '173994348');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Gone Frolicking: Grange', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178446848', 'Grange Community Hall, Newmarket', '2025-03-02T11:00:00+11:00', '2025-03-02T13:00:00+11:00', 'Sunday, 2 March 2025, 10am - 12pm', 'Girls of al ages just want to have fun!

Did you dance when you were younger? Maybe you never had the chance? It’s never too late to (re)start! Dancing is fun and really good for us throughout life, so come frolic with like-minded people!

Hosted by pro-ageing dance captain Dr Anja Ali-Haapala, our events are joyful, pop music-loving dance workshops. Designed to accommodate diverse over 50s, our priorities are dancing safely, socially connecting and getting sassy on the dance floor. By the end of the session you will perform a beginner-level jazz dance to a pop song from the 70s or 80s with new friends.

Not up to scratch with your dance technique? It doesn’t matter! This isn’t a technique class. All you need is a little courage and we’ll take care of the rest!', 'Community hall event', 'Creative,Fitness & well-being,Performing arts,Workshops', NULL, 'Fitness & well-being', '$55', 'https://www.trumba.com/i/DgC%2AqL1WvaSvq3jMzyflLijS.jpg', '50+', 'Bookings required via <a href="http://gonefrolicking.com.au/" target="_blank">Humanitix</a>.', TRUE, 'Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Grange Community Hall, Newmarket', NULL, NULL, '178446848');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958033', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-03-02T11:00:00+11:00', '2025-03-02T12:00:00+11:00', 'Sunday, 2 March 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgAUPKxT3P1v35EyxQegZAj5.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958033');
