First 5 Forever is an initiative of the Queensland Government, coordinated by State Library of Queensland and delivered in partnership with local government.', 'Library events', 'Free', 'First 5 Forever children''s literacy sessions', NULL, 'Free', 'https://www.trumba.com/i/DgB3%2A-GeQLhwcdnl3PpiP7tM.jpg', '2-5 year olds', 'Not required.', NULL, 'Preschool kids', 'Garden City Library', 'Garden City Library, Westfield Mt Gravatt, Level R4, corner of Logan Road and Kessels Road, Upper Mount Gravatt', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Children''s literacy,Children''s storytime', NULL, NULL, NULL, NULL, '179663932');
