Enjoy an afternoon in the beautiful grounds of Government House with Brisbane Brass as they present a lunchtime concert of classic brass with marches, movie themes and easy listening favourites amidst the gardens of this historical residence. Bring a picnic rug and relax on the lawns to the beat of brass.', 'Brisbane City Council', 'Creative,Family events,Free,Music', 'Bands in Parks', 'Music', 'Free', 'https://www.trumba.com/i/DgDJCSsJvYMLpq8POocfObL-.jpg', 'Suitable for all ages', 'No bookings required.', TRUE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180723248');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Cosmic Collisions', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786526', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-03-02T13:00:00+11:00', '2025-03-02T13:45:00+11:00', 'Sunday, 2 March 2025, 12 - 12:45pm', 'Collisions, both dazzling and destructive, release energy that drives the growth and evolution of the universe and shape our place within it. Produced by the American Museum of Natural History. Narrated by Robert Redford.

Session concludes with a virtual tour of the Brisbane night sky.

Cosmic Collisions was developed by the American Museum of Natural History, New York in collaboration with the Denver Museum of Nature & Science; GOTO INC, Tokyo, Japan; and the Shanghai Science & Technology Museum.
