INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Yoga', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174040802', 'New Farm Park, New Farm', '2025-03-02T16:00:00+11:00', '2025-03-02T17:00:00+11:00', 'Sunday, 2 March 2025, 3 - 4pm', 'Focus on a range of movements to relax the mind and body. Stretching, breathing, strength and balance exercises are included by incorporating mat work into the session.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcY02CtTmqwxedoGT-GRvp.jpeg', 'All ages', 'No bookings required. For more information phone Glenis on 0421 319 549.', NULL, NULL, 'New Farm Park, New Farm', 'New Farm Park, 137 Sydney Street, New Farm', 'Park', '.', 'Mind and body', 'Exercise mat and eye-pillow if desired.', 'Meet under the huge fenced tree in the centre of the park, near the rose arbour.', NULL, NULL, 'River hub (commercial) - 200 tonnes', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174040802');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786606', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-03-02T16:00:00+11:00', '2025-03-02T16:45:00+11:00', 'Sunday, 2 March 2025, 3 - 3:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.

Session concludes with a virtual tour of the Brisbane night sky.

Passport to the Universe was developed by the American Museum of Natural History, New York in collaboration with the National Aeronautics and Space Administration (NASA).
