INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Khruangbin', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d176571964', 'Riverstage, Brisbane City', '2025-03-02T18:30:00+11:00', '2025-03-02T23:00:00+11:00', 'Sunday, 2 March 2025, 5:30 - 10pm', 'They’re heralded as one of the USA’s finest live acts – a band unparalleled in groove. Now, Houston, Texas psych-funk trio Khruangbin return to Australia next summer with shows in Melbourne, Brisbane, and Sydney in February/March 2025 as part of their global A LA SALA tour.

Having recently wowed fans at European festivals such as Rock Werchter and Roskilde, bassist Laura Lee Ochoa, drummer Donald ‘DJ’ Johnson, Jr., and guitarist Mark ‘Marko’ Speer will return to Australia to celebrate their first album in four years: A LA SALA (“To the room” in Spanish). If 2020’s Mordechai was a party record that enhanced the band’s musical reputation, A LA SALA is the measured morning after. A gorgeously airy album made with minimal overdubs, A LA SALA scales Khruangbin down to scale up, a creative strategy with the future in mind.

Khruangbin launched the A LA SALA tour in April at Coachella, with sold out shows across US/Canada in May/June. With festival sets at Nos Alive (Lisbon), Latitude (Suffolk), Bilbao BBK (Spain) and Bonnaroo (US) on the itinerary, and European/UK dates in November, Khruangbin return to Australia in early 2025 for what promises to be some of the hottest shows this summer.

Joining Khruangbin as special guest at all shows and making their debut trip to Australia is acclaimed two-piece Hermanos Gutiérrez, the instrumental guitar duo of Swiss/Ecuadorian brothers Alejandro and Estevan Gutiérrez. The pair’s new album, Sonido Cósmico,  was released in June and produced by Dan Auerbach (The Black Keys). Brimming with Latin mystique and otherworldly guitar interplay that “shimmers with hallucinogenic energy” (Rolling Stone), the album is an odyssey through lush musical soundscapes, as heard on lead single ‘Barrio Hustle’.', 'Brisbane City Council', 'Featured,Music', NULL, 'Music', 'Priced ticketed event', 'https://www.trumba.com/i/DgDY4QBPVAdCWJc9xC3y85Ur.jpg', 'Suitable for all ages', 'Tickets can be purchased <a href="https://www.ticketmaster.com.au/khruangbin-brisbane-02-03-2025/event/130060FDA8F157C2" target="_blank">Ticketmaster</a>.', TRUE, NULL, 'Riverstage, Brisbane City', 'Riverstage, Gardens Point Road, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '176571964');
