Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Perrin Creek & Seven Hills Bushland Rehabilitation Group meet every Tuesday and every Friday, and the second Saturday of the month 7.30-10am.

