Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment.

With 160 groups across the city there’s bound to be one near you! 

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife  citizen science projects.The McDowall Bushcare Group meets weekly on Tuesday''s at 8.30am.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgDvHjuBGrMT21XY2RFFIIRS.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Lesley Watson on 0447 342 282 or email <a href="mailto:leswat50@gmail.com" target="_blank">leswat50@gmail.com</a>', TRUE, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178068915');
