INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Community Immunisation Clinic - Carindale (morning)', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178941807', 'Carindale Library', '2025-03-04T10:00:00+11:00', '2025-03-04T12:00:00+11:00', 'Tuesday, 4 March 2025, 9 - 11am', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgCpPZ9hIKB83A4ZbvDlsxxb.jpg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-carindale-morning-2025-tickets-1097657265429" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Carindale Library', 'Carindale Library, Westfield Carindale, 1151 Creek Road (near Millennium Boulevard), Carindale', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178941807');
