INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Bush Kindy - Clean Up Australia Day', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179702645', 'Karawatha Forest Park and Discovery Centre', '2025-03-04T11:00:00+11:00', '2025-03-04T11:45:00+11:00', 'Tuesday, 4 March 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3-5 years, alongside their parents and carers. Join Environment Centre staff as we celebrate Clean Up Australia Day by exploring nature, collecting rubbish, and learning how to care for our beautiful environment!

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day of the event: Please arrive 10 minutes before the start of the event to check in at the centre. All children must be accompanied and directly supervised by an adult. Please wear a wide-brimmed hat, sun-smart clothing, sunscreen, fully enclosed walking shoes and insect repellent. Please bring drinking water and a snack or picnic lunch as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play.Note: Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgBxkA-zqgRSR1lp%2AwjZWQd7.jpg', '3-5 years', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-clean-up-australia-day-tickets-1097685239099" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, NULL, 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179702645');
