Renowned Australian tenor Jonathon Welch AM, best known for his award-winning Choir of Hard Knocks, and spectacular performance on THE VOICE 2020, brings to life the music and career of one of the most popular Welsh tenors and comedian, Sir Harry Secombe.
Regarded as one of the finest tenors of his generation, Jonathon will thrill the audience with his stunning renditions of Secombe''s greatest hits including ''Love'', ''This is My Song'', ''Vienna City of My Dreams'', ''Bless this House'', ''Love is a Many Splendored Thing'', ''I Believe'' and his most popular signature song - ''If I Ruled the World!''

This Lord Mayor''s City Hall Concert is produced by Salubrious Productions', 'Brisbane City Council', 'Creative,Free,Music,Performing arts', 'Lord Mayor''s City Hall Concerts', 'Music', 'Free', 'https://www.trumba.com/i/DgCXvy2sIUfK2xuey7jEtA7j.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, 'Brisbane City Hall, Brisbane City', 'Brisbane City Hall, 64 Adelaide Street, Brisbane City', 'General Council venue,Library,Light up asset', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179367872');
