Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment.

With 160 groups across the city there’s bound to be one near you! 

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife  citizen science projects.The Dowse Lagoon Bushcare Group meets weekly on Wednesday''s at 6.30am.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgDMXszl8k6unz-RezYaBD8%2A.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Frank Box 0421 488 622 or email <a href="mailto:frank@ozbox.net.au" target="_blank">frank@ozbox.net.au</a>', TRUE, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178068953');
