Talk to a Planner is available all year round, with additional sessions held regularly across the city for your convenience.

During these free sessions you can speak face-to-face with a planning specialist, giving you the opportunity to ask any questions you may have about how City Plan relates to your property.

Council also has a team of dedicated officers who can answer simple questions about your development application over the phone during business hours (9am-4pm, Monday-Friday). To speak to an officer please phone Council on 07 3403 8888 and ask to speak with a Planning Information Officer.', 'Brisbane City Council', 'Free,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgDDj7Yfnr2DtZoLUimpd70i.jpeg', 'Open', 'Sessions are by appointment only. Book your 15 minute appointment via <a href="https://www.eventbrite.com.au/e/talk-to-a-planner-business-hub-cbd-5-march-2025-tickets-1210400182529" target="_blank">Eventbrite</a>.&nbsp;', TRUE, NULL, 'Brisbane Business Hub', 'Level 2, Brisbane Business Hub, 155 Queen Street, Brisbane City', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180078979');
