INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Community Immunisation Clinic - Everton Park', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942011', 'Everton Park Library', '2025-03-05T10:30:00+11:00', '2025-03-05T12:00:00+11:00', 'Wednesday, 5 March 2025, 9:30 - 11am', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgD5MTuurM7kIhGSueGtCnGQ.jpg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-everton-park-2025-tickets-1091859263449" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Everton Park Library', 'Everton Park Library, 573 South Pine Road, Everton Park', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942011');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Educational and interactive puppet shows for toddlers and preschooler kids', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179654379', 'Upper Mt Gravatt Progress Hall, Upper Mount Gravatt', '2025-03-05T10:30:00+11:00', '2025-03-05T11:15:00+11:00', 'Wednesday, 5 March 2025, 9:30 - 10:15am', 'Little Bunnies Puppetry provides a range of interactive experiences tailored for children aged 13 months to five years: Weekly 45-minute sessions featuring new puppet stories Interactive songs and classic nursery rhymes Educational content covering basic counting, colour recognition, shapes, vocabulary, and more! Exploration of emotions through storytelling Free play time with puppet sets and special puppet theatre Costume dress-up opportunities for memorable photo moments Dance and movement activitiesOur small group setting, limited to 15 children, ensures personalized attention and a comfortable learning environment.

The program''s creative and original approach, which integrates puppets and music, enables children to develop interactive abilities, enhance communication skills, and sharpen their problem-solving skills.', 'Brisbane City Council', 'Family events', NULL, 'Family events', '$25', 'https://www.trumba.com/i/DgAeVusDww6WcfTcBzvZOmp5.jpg', '13 months to 5 years', 'Bookings are essential. Space is limited to ensure an intimate, quality experience for each child.

Book your free trial session today by visiting our <a href="https://littlebunniespuppetry.com.au/" target="_blank">website</a>&nbsp;and give your little one the gift of learning through puppetry and play.', TRUE, 'Infants and toddlers,Preschool kids', 'Upper Mt Gravatt Progress Hall, Upper Mount Gravatt', 'Upper Mt Gravatt Progress Hall, 1873 Logan Road, Upper Mount Gravatt', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179654379');
