Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: Managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projectsThe Tennis Avenue Bushcare Group meet the first Sunday of the month, and every Thursday morning, both 7am - 9am at Tennis Avenue Park, 23 Tennis Avenue, Ashgrove.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgAZ2lurlFY%2AHtX4W3hI5gGW.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader&nbsp;Scott Wyman on 0476 225 449 or send an email&nbsp;<a href="http://tennisavebcg@gmail.com" target="_blank">tennisavebcg@gmail.com</a>.', TRUE, 'Young adults,Adults (30+),Seniors', 'Tennis Avenue Park, Ashgrove', 'Tennis Avenue Park, 35 Tennis Avenue, Ashgrove', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178748670');
