INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958037', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-03-06T11:00:00+11:00', '2025-03-06T12:00:00+11:00', 'Thursday, 6 March 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgAUPKxT3P1v35EyxQegZAj5.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958037');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957404', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-03-06T11:00:00+11:00', '2025-03-06T12:00:00+11:00', 'Thursday, 6 March 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgB7OhUwZOCMvzzoow59j2U7.jpg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957404');
