INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Bush Kindy - World Wildlife Day show', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179859851', 'Boondall Wetlands Environment Centre', '2025-03-06T11:00:00+11:00', '2025-03-06T12:00:00+11:00', 'Thursday, 6 March 2025, 10 - 11am', 'Bush Kindy is for children aged 3-5 years, alongside their parents and adult carers. Join our wildlife expert for this special World Wildlife Day Bush Kindy and meet some of the friends that live in our neighbourhoods.

Bush Kindy sessions can go for up to 45 minutes and themes vary each week.

On the day of the event: Arrive 10 minutes before the start of the event to check in at the centre. All children must be accompanied and directly supervised by an adult. Please wear sun-smart clothing, fully enclosed walking shoes, and bring sunscreen and insect repellent. Bring drinking water and a snack as there are no food outlets on site.Note: Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgATuTt-T5Tyo9YZCJgSNoXO.jpg', '3-5 years', 'Bookings are required through <a href="https://www.eventbrite.com.au/e/bush-kindy-world-wildlife-day-show-tickets-1096899127819" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', NULL, NULL, 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179859851');
