This is a GOLD event suitable for seniors.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgAxY0Zm3xTBSnZIL%2AQkyk4Z.jpg', 'Seniors', 'No Bookings required. For more information phone BRIZCHI on 0402 714 494.', NULL, 'Seniors', 'Burnie Brae Park, Chermside', 'Burnie Brae Park, 60 Kuran Street, Chermside', 'Community Garden,Park', '.', 'Mind and body', NULL, 'Beside the off leash dog area.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '173998049');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Perrin Creek & Seven Hills Bushland Rehabilitation Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178573063', 'Seven Hills Bushland Reserve, Seven Hills', '2025-03-07T08:30:00+11:00', '2025-03-07T11:00:00+11:00', 'Friday, 7 March 2025, 7:30 - 10am', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Perrin Creek & Seven Hills Bushland Rehabilitation Group meet every Tuesday and every Friday, and the second Saturday of the month 7.30-10am.

