Requirements: All babies must be accompanied and directly supervised by an adult. Wear a wide-brimmed hat, sun-smart clothing, sunscreen, fully enclosed walking shoes and insect repellent. Bring drinking water and a snack or picnic lunch as there are no food outlets on site.

