The First 5 Forever initiative is funded by the Queensland Government.', 'Library events', 'Creative,Family events,Free', 'First 5 Forever children''s literacy sessions', NULL, 'Free', 'https://www.trumba.com/i/DgDdaot7NJFpABm9pXscEFN-.jpg', '0-5 year olds', 'Not required.', NULL, 'Infants and toddlers,Preschool kids', 'Chermside Library', 'Chermside Library, 375 Hamilton Road, Chermside', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Children''s literacy', NULL, NULL, NULL, NULL, '179612187');
