INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786376', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-03-07T15:00:00+11:00', '2025-03-07T15:45:00+11:00', 'Friday, 7 March 2025, 2 - 2:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.

Session concludes with a virtual tour of the Brisbane night sky.

Passport to the Universe was developed by the American Museum of Natural History, New York in collaboration with the National Aeronautics and Space Administration (NASA).
