INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('NIKI Buzz World Tour', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178814967', 'Riverstage, Brisbane City', '2025-03-07T19:00:00+11:00', '2025-03-07T23:00:00+11:00', 'Friday, 7 March 2025, 6 - 10pm', '*** This event has been relocated to the Eatons Hill Hotel *** Please be advised that the NIKI performance originally scheduled to take place at Riverstage on Friday 7 March will now go ahead at Eatons Hill Hotel on the same date of Friday 7 March, 2025. For any ticketing questions, contact your point of purchase.

On Buzz, her songwriting remains as intimate as ever. In her initial sketches of songs for Buzz, NIKI took cues from other lane-paving women with confessional, honest lyricism soundtracked by guitars. “Joni Mitchell is my songwriting north star,” she says — and uncompromising feminist luminaries like Stevie Nicks, Carly Simon and Liz Phair. To match the wandering spirit of Buzz, NIKI cultivated her own elastic approach to guitar.

For NIKI, things have been happening progressively since she was a high schooler in Jakarta, Indonesia. As a student at an international academy, she cut her teeth scribbling lovesick poems in English class and performed acoustic guitar covers of American pop songs on YouTube. With a six-string in hand, and her family and classmates cheering her on from the audience, Nicole Zefanya then staked her claim to global stardom as NIKI.

And claim it she has - with over three billion streams worldwide, sold out shows on multiple continents, massive sets at festivals across the globe, front row seats at Paris Fashion Week, four songs on a Marvel film’s soundtrack, and some of the most phenomenal, confessional songs being released in 2024, NIKI has already established a veteran’s resume before the age of 25. Buzz reverberates with the hard-earned wisdom of a young woman who charges dauntlessly towards her dreams - but can still spare a laugh if she stumbles.', 'Brisbane City Council', 'Music', NULL, 'Music', 'Priced ticketed event', 'https://www.trumba.com/i/DgBirISYyYsWFCihh3MspKvj.jpg', 'Suitable for all ages', '***Event has been relocated***

Tickets purchased via <a href="https://www.ticketmaster.com.au/niki-buzz-world-tour-brisbane-07-03-2025/event/1300616F851A79D1" target="_blank">Ticketmaster</a>.', TRUE, NULL, 'Riverstage, Brisbane City', 'Riverstage, Gardens Point Road, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178814967');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Relic | Australasian Dance Collective', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180301986', 'Urban Art Projects'' Foundry, 41 Holland Street, Northgate', '2025-03-07T19:30:00+11:00', '2025-03-07T20:20:00+11:00', 'Friday, 7 March 2025, 6:30 - 7:20pm', 'Step into the world of Relic - a daring reimagining of Jack Lister’s award-winning  Still Life film trilogy.

In an unprecedented collaboration, Australasian Dance Collective (ADC) and Urban Art Projects (UAP) invite you to experience art as never before, in a site-specific dance theatre creation that defies the boundaries between performance and visual art.

Crafted for the imposing UAP Foundry, Relic explores the interplay of mortality, fragility, youth and spirit. Inspired by the timeless themes of 16th and 17th-century still life paintings and the haunting symbolism of the memento mori movement, Relic reimagines these age-old notions of mortality through the fearless spirit of motocross - helmets for skulls, smoking rubber for snuffed-out candles, and the inevitable heralding of the final lap for the sands in the hourglass.

The Australasian Dance Collective is proudly supported by Brisbane City Council. For more information, visit the Australasian Dance Collective website.', 'Brisbane City Council', 'Creative,Culture,Featured,Performing arts', NULL, 'Performing arts', 'Adult - $55; Concession - $45; Youth (under 30) - $30; Group of 4 - $200; School groups - contact ADC to book', 'https://www.trumba.com/i/DgCE32tQjKBzl2QpcBYGAA1G.jpg', 'Suitable for all ages', 'Bookings required. To book, visit the <a href="https://australasiandancecollective.com/performances/2025/relic-2025" target="_blank">Australasian Dance Collective website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180301986');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Macbeth', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180046059', 'La Boite Theatre, Kelvin Grove', '2025-03-07T20:30:00+11:00', '2025-03-07T22:00:00+11:00', 'Friday, 7 March 2025, 7:30 - 9pm', 'La Boite Theatre presents 

A show of war lost and won!

The prophets who once hailed Macbeth, foretelling his rise to power, have lingered in the shadows for too long. Now, the Weird Sisters step out from the wings and take centre stage.

In this reimagining of Shakespeare’s Macbeth, the Witches—whose cryptic prophecies drive Macbeth to murder, madness, and ruin—become the focus. Their deep spiritual and philosophical connection to the Earth reveals a world groaning under the weight of human ambition. Through their eyes, we see not just Macbeth’s bloody climb to the throne, but the profound consequences of our insatiable desire for power.

In this innovative production, the Weird Sisters are no longer mere bystanders. They embody the forces of nature itself, their voices intertwined with the Earth’s cries for balance and need for healing. Blending dance, movement, text and sound, this hybrid performance explores the interconnectedness of all things—reminding us that every action we take ripples through the natural world.

Co-directed by La Boite Theatre’s Artistic Director Courtney Stewart and Lisa Fa’alafi (Co-Artistic Director Polytoxic, Hot Brown Honey), with a dynamic local cast, this production also welcomes back the formidable Sue Rider, former Artistic Director of La Boite, as dramaturg.

Opening on International Women’s Day, experience a bold new take on one of Shakespeare’s greatest tragedies in this daring reimagining of Macbeth.

Discover more at https://laboite.com.au/shows/macbeth.', 'Brisbane City Council', 'Performing arts', NULL, NULL, 'Tickets from $28 - $65', 'https://www.trumba.com/i/DgDa5gc2moTU5L-Xf8TMgZ7D.jpg', '15+', 'Bookings are required via <a href="https://tickets.laboite.com.au/overview/macbeth-2025" target="_blank">La Boite Theatre website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', 'La Boite Theatre, Kelvin Grove', 'La Boite Theatre, 6-8 Musk Avenue, Kelvin Grove', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180046059');
