INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Understory by Rachel Apelt', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d181110495', 'Boondall Wetlands Environment Centre', '2025-03-08T10:00:00+11:00', '2025-03-08T17:00:00+11:00', 'Saturday, 8 March 2025, 9am - 4pm', 'Be drawn into a dialogue with nature through Rachel Apelt’s Understory.

Visual artist Rachel Apelt, who lives in the upper catchment of Kedron Brook and Cabbage Tree Creek, shares her deep connection to nature with this exhibition. A ‘walking artist,’ her work presents details and impressions from her daily walks along creeklines and forest reserves. The work celebrates the special role of Macaranga trees in creekline regeneration, highlighting their beauty and ecological importance as well as the sense of community that can flourish in their shade.

Understory is open now until 30 May 2025 at the Boondall Wetland Environment Centre.

Open hours:
Tuesday - Friday 9am - 4pm
Saturday - Sunday 9am - 12pm', 'Brisbane City Council', 'Art,Exhibitions', NULL, 'Art', 'Free', 'https://www.trumba.com/i/DgBcNONfJR-%2A3%2AhTaNLWTVmA.jpg', 'All ages', 'No bookings required.', TRUE, NULL, 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '181110495');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Men of the Trees (Paten Park Bushcare Group)', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179123583', 'Paten Park, The Gap', '2025-03-08T10:00:00+11:00', '2025-03-08T13:30:00+11:00', 'Saturday, 8 March 2025, 9am - 12:30pm', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Men of the Trees (Paten Park Bushcare Group) meet weekly, every Saturday 9am-12:30pm.

