Brace yourself, Brisbane! The most awaited Festival of Colours bigger and brighter than ever. Holi is a celebration of love, unity, and happiness, bringing together people from all multicultural communities to dance, sing, and splash in a riot of colours!

Highlights include: Spectacular live singing and dance performances Non-stop DJ beats and Bollywood bangers Mouth-watering food stalls Massive colour throws and vibrant market stallsGather your squad, wear your whites, and let’s make Holi 2025 an explosion of joy and colour! 

