Food trucks on site before the movie screening.

This movie screening will have subtitles.

This event is pet friendly. Please keep your furry friends on a leash if you decide to bring them along.', 'Brisbane City Council', 'Creative,Family events,Featured,Films,Food,Free', 'Outdoor Cinema in the Suburbs', 'Family events', 'Free', 'https://www.trumba.com/i/DgD%2AsX752IsYfJTBifC1odj0.jpg', 'Suitable for all ages', 'No bookings required.', TRUE, NULL, 'Biami Yumba Park, Fig Tree Pocket', 'Biami Yumba Park (Fig Tree Pocket Reserve), 838 Fig Tree Pocket Road, Fig Tree Pocket', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179718484');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Alexisonfire with Underoath', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178750987', 'Riverstage, Brisbane City', '2025-03-08T18:00:00+11:00', '2025-03-08T23:00:00+11:00', 'Saturday, 8 March 2025, 5 - 10pm', 'Canadian hardcore luminaries Alexisonfire announce their Australian return for March 2025, alongside iconic US rockers Underoath and New Jersey punk four-piece Gel, in what will be an unmissable series of shows for local hard music lovers.

Alexisonfire was last in Australia in February 2023 touring Otherness, the band’s first album in over a decade. Admired by local audiences, on their ninth visit, the five-piece will perform songs from an enduring catalogue spanning more than twenty years.

The band’s legacy across Canada and the world cannot be overstated; from opening to Blink 182 at Toronto’s Rogers Centre Stadium in August, to announcing on the 2025 instalment of When We Were Young festival in Las Vegas, Alexisonfire continue to dominate.', 'Brisbane City Council', 'Featured,Music', NULL, 'Music', 'Priced ticketed event', 'https://www.trumba.com/i/DgCDojtf939AG8OB-8hSI0cs.jpg', 'Suitable for all ages', 'Tickets can be purchased via <a href="https://www.ticketmaster.com.au/alexisonfire-with-underoath-brisbane-08-03-2025/event/1300616BDAB58E11" target="_blank">Ticketmaster</a>.', TRUE, NULL, 'Riverstage, Brisbane City', 'Riverstage, Gardens Point Road, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178750987');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Relic | Australasian Dance Collective', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180301987', 'Urban Art Projects'' Foundry, 41 Holland Street, Northgate', '2025-03-08T19:30:00+11:00', '2025-03-08T20:20:00+11:00', 'Saturday, 8 March 2025, 6:30 - 7:20pm', 'Step into the world of Relic - a daring reimagining of Jack Lister’s award-winning  Still Life film trilogy.

In an unprecedented collaboration, Australasian Dance Collective (ADC) and Urban Art Projects (UAP) invite you to experience art as never before, in a site-specific dance theatre creation that defies the boundaries between performance and visual art.

Crafted for the imposing UAP Foundry, Relic explores the interplay of mortality, fragility, youth and spirit. Inspired by the timeless themes of 16th and 17th-century still life paintings and the haunting symbolism of the memento mori movement, Relic reimagines these age-old notions of mortality through the fearless spirit of motocross - helmets for skulls, smoking rubber for snuffed-out candles, and the inevitable heralding of the final lap for the sands in the hourglass.

The Australasian Dance Collective is proudly supported by Brisbane City Council. For more information, visit the Australasian Dance Collective website.', 'Brisbane City Council', 'Creative,Culture,Featured,Performing arts', NULL, 'Performing arts', 'Adult - $55; Concession - $45; Youth (under 30) - $30; Group of 4 - $200; School groups - contact ADC to book', 'https://www.trumba.com/i/DgCE32tQjKBzl2QpcBYGAA1G.jpg', 'Suitable for all ages', 'Bookings required. To book, visit the <a href="https://australasiandancecollective.com/performances/2025/relic-2025" target="_blank">Australasian Dance Collective website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180301987');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Macbeth', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180046060', 'La Boite Theatre, Kelvin Grove', '2025-03-08T20:30:00+11:00', '2025-03-08T22:00:00+11:00', 'Saturday, 8 March 2025, 7:30 - 9pm', 'La Boite Theatre presents 

A show of war lost and won!

The prophets who once hailed Macbeth, foretelling his rise to power, have lingered in the shadows for too long. Now, the Weird Sisters step out from the wings and take centre stage.

In this reimagining of Shakespeare’s Macbeth, the Witches—whose cryptic prophecies drive Macbeth to murder, madness, and ruin—become the focus. Their deep spiritual and philosophical connection to the Earth reveals a world groaning under the weight of human ambition. Through their eyes, we see not just Macbeth’s bloody climb to the throne, but the profound consequences of our insatiable desire for power.

In this innovative production, the Weird Sisters are no longer mere bystanders. They embody the forces of nature itself, their voices intertwined with the Earth’s cries for balance and need for healing. Blending dance, movement, text and sound, this hybrid performance explores the interconnectedness of all things—reminding us that every action we take ripples through the natural world.

Co-directed by La Boite Theatre’s Artistic Director Courtney Stewart and Lisa Fa’alafi (Co-Artistic Director Polytoxic, Hot Brown Honey), with a dynamic local cast, this production also welcomes back the formidable Sue Rider, former Artistic Director of La Boite, as dramaturg.

Opening on International Women’s Day, experience a bold new take on one of Shakespeare’s greatest tragedies in this daring reimagining of Macbeth.

Discover more at https://laboite.com.au/shows/macbeth.', 'Brisbane City Council', 'Performing arts', NULL, NULL, 'Tickets from $28 - $65', 'https://www.trumba.com/i/DgDa5gc2moTU5L-Xf8TMgZ7D.jpg', '15+', 'Bookings are required via <a href="https://tickets.laboite.com.au/overview/macbeth-2025" target="_blank">La Boite Theatre website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', 'La Boite Theatre, Kelvin Grove', 'La Boite Theatre, 6-8 Musk Avenue, Kelvin Grove', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180046060');
