The Australasian Dance Collective is proudly supported by Brisbane City Council. For more information, visit the Australasian Dance Collective website.', 'Brisbane City Council', 'Creative,Culture,Featured,Performing arts', NULL, 'Performing arts', 'Adult - $55; Concession - $45; Youth (under 30) - $30; Group of 4 - $200; School groups - contact ADC to book', 'https://www.trumba.com/i/DgCE32tQjKBzl2QpcBYGAA1G.jpg', 'Suitable for all ages', 'Bookings required. To book, visit the <a href="https://australasiandancecollective.com/performances/2025/relic-2025" target="_blank">Australasian Dance Collective website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180432593');
