INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Small Bird Reserve Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178068890', 'Curlew Park, Sandgate', '2025-03-09T08:00:00+11:00', '2025-03-09T10:30:00+11:00', 'Sunday, 9 March 2025, 7 - 9:30am', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment.

With 160 groups across the city there’s bound to be one near you! 

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife  citizen science projects.The Small Bird Bushcare Group meets monthly on the 2nd Sunday of the month at 7am.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgBrx2hCGrXoT72l8fSCclUp.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Frank Box on 0421 488 622 or email <a href="mailto:frank@ozbox.net.au" target="_blank">frank@ozbox.net.au</a>', TRUE, 'Young adults,Adults (30+),Seniors', 'Curlew Park, Sandgate', 'Curlew Park, 74 Curlew Street, Sandgate', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, 'Canoe ramp', 'Hutchinson Slipway |&nbsp;Status: open', NULL, NULL, NULL, NULL, NULL, NULL, '178068890');
