INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Enoggera Creek Reserve Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178519249', 'Enoggera Creek Reserve, Ashgrove', '2025-03-09T08:30:00+11:00', '2025-03-09T10:00:00+11:00', 'Sunday, 9 March 2025, 7:30 - 9am', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

