First 5 Forever is an initiative of the Queensland Government, coordinated by State Library of Queensland and delivered in partnership with local government.', 'Library events', 'Free', 'First 5 Forever children''s literacy sessions', NULL, 'Free', 'https://www.trumba.com/i/DgB3%2A-GeQLhwcdnl3PpiP7tM.jpg', '2-5 year olds', 'Not required.', NULL, 'Preschool kids', 'Garden City Library', 'Garden City Library, Westfield Mt Gravatt, Level R4, corner of Logan Road and Kessels Road, Upper Mount Gravatt', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Children''s literacy,Children''s storytime', NULL, NULL, NULL, NULL, '179663933');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Reading for reconciliation', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179417501', 'Brisbane Square Library', '2025-03-09T11:30:00+11:00', '2025-03-09T13:30:00+11:00', 'Sunday, 9 March 2025, 10:30am - 12:30pm', 'Improve your knowledge and understanding of Aboriginal and Torres Strait Islander issues and histories. Our group seeks to assist members of the community to start a reconciliation journey through reading and discussing selected texts in an informal and friendly setting. In March, read and discuss Edenglassie by Melissa Lucashenko.', 'Library events', 'Aboriginal and Torres Strait Islander,Culture,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB93KGIG8Hx6dYgTEZTTRaW.jpg', 'Young adults, Adults (30+), Seniors', 'Not required.', NULL, 'Young adults,Adults (30+),Seniors', 'Brisbane Square Library', 'Brisbane Square Library, 266 George Street, Brisbane City', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Book clubs,Literary events', NULL, NULL, NULL, NULL, '179417501');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Contemporary women in the Australian Defence Force', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180672347', 'Anzac Square, Brisbane City', '2025-03-09T11:30:00+11:00', '2025-03-09T12:30:00+11:00', 'Sunday, 9 March 2025, 10:30 - 11:30am', 'In celebration of International Women''s Day, join us for a free talk on the changing nature of contemporary ADF service and the experiences of ADF women over the past 20 years.

Presented by special guest speaker Natalie Merryman, this talk will delve into the reforms and policy changes that have opened possibilities for women in the ADF, the accomplishments of contemporary ADF women, and the lack of real recognition of women as veterans in the community. Natalie will discuss her research project and findings to illustrate why this is, what the consequences are, and what needs to change to address the issue.

Natalie Merryman is a PhD candidate in Sociology at the University of Newcastle, focusing on the gendered experiences of women veterans in the Australian Defence Force (ADF). A military veteran herself, Natalie brings a wealth of practical experience to her research having worked as a Registered Nurse and a volunteer Military Compensation Advocate. Natalie is deeply embedded in the veteran community, having served with a number of veteran support organisations and is also a casual Research Assistant with the Open Door Veteran Research Initiative at Flinders University.

Natalie has also achieved notable academic success and was winner of the Student of the Year award at the Veteran, Emergency Services & Police Industry Institute of Australia (VESPIIA) 2024 Excellence Awards. During 2024, Natalie presented her research at the DVA Women Veterans’ Policy Forum, Scottish International Conference on Armed Forces in Society and also at the Australian Women’s and Gender Studies Association Biannual Conference. She has also been invited to present her research at the UK Centre for Military Women’s Research 2025 conference at Cambridge University.

Natalie has spent over 20 years advocating for veterans and defence personnel. Her motivation stems from a deep commitment to gender equality, diversity, and inclusion. She aims to use her research to inform policies and interventions that improve outcomes for veterans and their families including efforts to end veteran suicide.

After the talk, visitors can stay to explore the Memorial Galleries, embarking on an interactive journey from the First World War to today, before taking time to reflect on the remarkable stories of bravery and sacrifice in the tranquil parklands.

Anzac Square Memorial Galleries is located at 285 Ann Street, Brisbane. Entry is through the double brass doors located beneath the Shrine of Remembrance.', 'Brisbane City Council', 'Culture,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgDbsIJyxDABTJwCj-bUZdTw.jpg', 'Suitable for all ages', 'Bookings required via the <a href="https://www.anzacsquare.qld.gov.au/whats-on/contemporary-women-australian-defence-force" target="_blank">Anzac Square website</a>.&nbsp;', TRUE, NULL, 'Anzac Square, Brisbane City', 'Anzac Square, 228 Adelaide Street, Brisbane City', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180672347');
