INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Magic Globe: A Story of the Seasons', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786506', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-03-09T12:00:00+11:00', '2025-03-09T12:35:00+11:00', 'Sunday, 9 March 2025, 11 - 11:35am', 'Magic Globe: A Story of the Seasons is an animated adventure that is perfect for engaging children from 5 to 12 years old.

On vacation at her grandpa’s, a little girl named Mia accidentally discovers a mysterious piece of astronomical machinery. Edmund, Mia’s eccentric uncle, tricks the girl into using the tool’s secret powers to change the world’s seasons. She realizes the consequences of what they are going to do, but Edmund doesn’t want to let the plan go...

