INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Saba''s Corner Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178568619', 'Dawn Street Park, Bardon', '2025-03-09T15:00:00+11:00', '2025-03-09T16:30:00+11:00', 'Sunday, 9 March 2025, 2 - 3:30pm', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Saba''s Corner Bushcare Group meet monthly on the second Sunday of the month 2pm-3.30pm.

Location: Dawn Street Park, 140 Coopers Camp Road, Bardon', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgArxuztRofpn5fKcBX5oc3s.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Mel Isaacs on 0419 149 800 or email <a href="mailto:zax.mel@gmail.com" target="_blank">zax.mel@gmail.com</a>', TRUE, 'Young adults,Adults (30+),Seniors', 'Dawn Street Park, Bardon', 'Dawn Street Park, 140 Coopers Camp Road, Bardon', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178568619');
