The Amadeus Orchestra will transport audiences through time and around the world with famous pieces such as Rossini’s “Barber of Seville Overture” and Sarasate’s “Carmen Fantasy” with soloist Tristan Seleke. Allow yourself to be captured by these nostalgic, familiar tunes made famous by films and pop musicians through the ages.

There will be afternoon tea and scones available for purchase as well as wine and cheese packs. Make it an afternoon out – invite family and friends for an afternoon at City Hall. If you would like to sit and sip with a glass of wine and cheese plate, or enjoy afternoon tea and cake, bookings can be made by calling 0439 716 389.', 'Brisbane City Council', 'Creative,Culture,Family events,Food,Free,Music', 'Bands in Parks', 'Music', 'Free', 'https://www.trumba.com/i/DgBttdGTlENBtUX6I2f%2AagP4.jpg', 'Suitable for all ages', 'No bookings required. To book afternoon tea, call Epicure on 0439 716 389.', NULL, NULL, 'Brisbane City Hall, Brisbane City', 'Brisbane City Hall, 64 Adelaide Street, Brisbane City', 'General Council venue,Library,Light up asset', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180723330');
