Welcome to the first in the series of Music on the Green at Grange Bowls Club for 2025. Get ready to swing and sway to the timeless tunes of BSB Swing. Invite family and friends for an afternoon on the green.

The bar will be trading and there will be picnic baskets and cheeseboards for purchase.', 'Brisbane City Council', 'Creative,Family events,Food,Free,Music', 'Bands in Parks', 'Music', 'Free', 'https://www.trumba.com/i/DgC4HKZ27RUFzl0N8Sfm1poG.jpeg', 'Suitable for all ages', 'No bookings required.', TRUE, NULL, 'Lanham Park, Grange', 'Lanham Park, 75 Sellheim Street, Grange', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180723374');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Relic | Australasian Dance Collective', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180301988', 'Urban Art Projects'' Foundry, 41 Holland Street, Northgate', '2025-03-09T19:30:00+11:00', '2025-03-09T20:20:00+11:00', 'Sunday, 9 March 2025, 6:30 - 7:20pm', 'Step into the world of Relic - a daring reimagining of Jack Lister’s award-winning  Still Life film trilogy.

In an unprecedented collaboration, Australasian Dance Collective (ADC) and Urban Art Projects (UAP) invite you to experience art as never before, in a site-specific dance theatre creation that defies the boundaries between performance and visual art.

Crafted for the imposing UAP Foundry, Relic explores the interplay of mortality, fragility, youth and spirit. Inspired by the timeless themes of 16th and 17th-century still life paintings and the haunting symbolism of the memento mori movement, Relic reimagines these age-old notions of mortality through the fearless spirit of motocross - helmets for skulls, smoking rubber for snuffed-out candles, and the inevitable heralding of the final lap for the sands in the hourglass.

The Australasian Dance Collective is proudly supported by Brisbane City Council. For more information, visit the Australasian Dance Collective website.', 'Brisbane City Council', 'Creative,Culture,Featured,Performing arts', NULL, 'Performing arts', 'Adult - $55; Concession - $45; Youth (under 30) - $30; Group of 4 - $200; School groups - contact ADC to book', 'https://www.trumba.com/i/DgCE32tQjKBzl2QpcBYGAA1G.jpg', 'Suitable for all ages', 'Bookings required. To book, visit the <a href="https://australasiandancecollective.com/performances/2025/relic-2025" target="_blank">Australasian Dance Collective website</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180301988');
