This is a GOLD event suitable for seniors.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgApX17WE6Vg39yXiih9hYWw.jpg', 'Seniors', 'Bookings not required. For more information phone Mary from Australian Academy of Tai Chi on 0400 347 700.', NULL, 'Seniors', 'Seville Park, Holland Park', 'Seville Park, 5 Elgar Street, Holland Park', 'Park', '*', 'Mind and body', NULL, 'At the playground on Elgar Street.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174850328');
