INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958042', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-03-11T11:00:00+11:00', '2025-03-11T12:00:00+11:00', 'Tuesday, 11 March 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

