INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179183211', 'Downfall Creek Bushland Centre', '2025-03-11T11:00:00+11:00', '2025-03-11T11:45:00+11:00', 'Tuesday, 11 March 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day of the event Arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play. Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgCcUGErT5E-WPhRP9FuH7i5.jpg', 'Ages 3 - 5', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1096847493379" target="_blank">Eventbrite</a>.<p>All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.</p>', TRUE, 'Preschool kids', 'Downfall Creek Bushland Centre', 'Downfall Creek Bushland Centre, 815 Rode Road, Chermside West', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179183211');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179886151', 'Karawatha Forest Park and Discovery Centre', '2025-03-11T11:00:00+11:00', '2025-03-11T11:45:00+11:00', 'Tuesday, 11 March 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

