As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, NULL, 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179886151');
