INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Lord Mayor''s City Hall Concerts - The Songs of Sir Elton John', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179438685', 'Brisbane City Hall, Brisbane City', '2025-03-11T13:00:00+11:00', '2025-03-11T14:00:00+11:00', 'Tuesday, 11 March 2025, 12 - 1pm', 'Lord Mayor''s City Hall Concerts presents The Songs of Sir Elton John.

THIS CONCERT WILL BE AUSLAN INTERPRETED.

The legendary Sir Elton John has provided the soundtrack to the lives of millions around the world. From the glamour of the seventies and the excesses of the eighties, Sir Elton’s music and influence is still felt by today’s generations.

Bringing these fabulous tunes to life is Brisbane’s own piano bar veteran Michael Hynes with ''The Songs of Sir Elton''. Michael and band have a blast showing off the piano thumping energy of hard rocking hits like ‘I’m Still Standing’ and ‘Crocodile Rock’ through to the captivating ballads such as ‘Tiny Dancer’ and the immortal ‘Your Song’.

Brought to you as Sir Elton did in the early seventies as a piano, bass and drums trio, you can’t help but be reminded of the genius of Sir Elton’s song-writing partnership with lyricist Bernie Taupin. These songs will live forever.

This Lord Mayor''s City Hall Concert is produced by Evolution Productions.', 'Brisbane City Council', 'Creative,Free,Music,Performing arts', 'Lord Mayor''s City Hall Concerts', NULL, 'Free', 'https://www.trumba.com/i/DgBfYgRf8AS6Qg07g6xkOHl7.jpg', 'Open', 'No bookings required.', TRUE, NULL, 'Brisbane City Hall, Brisbane City', 'Brisbane City Hall, 64 Adelaide Street, Brisbane City', 'General Council venue,Library,Light up asset', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179438685');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958398', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-03-11T13:00:00+11:00', '2025-03-11T14:00:00+11:00', 'Tuesday, 11 March 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB5UB5rQjgKE8xMwsGuVN8N.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958398');
