INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Walan Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178069057', 'Northey Street City Farm, Northey Street Park, 24 Edgar Street, Windsor', '2025-03-11T16:00:00+11:00', '2025-03-11T18:00:00+11:00', 'Tuesday, 11 March 2025, 3 - 5pm', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment.

With 160 groups across the city there’s bound to be one near you! 

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife  citizen science projects.The Walan Bushcare Group meets monthly on the second Tuesday of the month at 3pm.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgBUS16xqVUMSZgh7yhXwQNu.jpg', 'Suitable for adults', 'Bookings required.&nbsp;For more information, or to join a volunteer working bee, contact volunteer group leader Richard on 0411 871 953 or email <a href="mailto:richard3939@gmail.com" target="_blank">richard3939@gmail.com</a>', TRUE, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178069057');
