INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('New Order', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178315552', 'Riverstage, Brisbane City', '2025-03-11T19:00:00+11:00', '2025-03-11T23:00:00+11:00', 'Tuesday, 11 March 2025, 6 - 10pm', 'Iconic synth-pop pioneers, New Order have today announced an Australian tour for March 2025.  The tour will see them perform all the biggest hits from their impressive four-decade, 10-album career on stages across Perth, Melbourne, Brisbane and Sydney in March 2025.  

Their first Australian tour since 2020, New Order will transform some of the country’s most beloved live music venues into synth-pop laser wonderlands. They hit RAC Arena (Perth) on March 5, Sidney Myer Music Bowl (Melbourne) on March 8, Riverstage (Brisbane) on March 11, and finishing up with two shows on the spectacular Sydney Opera House Forecourt on March 14 and 15.', 'Brisbane City Council', 'Featured,Music', NULL, 'Music', 'Priced ticketed event', 'https://www.trumba.com/i/DgBjtQ1vLimWxaIU5x9TsIQG.jpg', 'Suitable for all ages', 'Bookings required via <a href="http://www.ticketmaster.com.au" target="_blank">Ticketmaster</a>&nbsp;or <a href="https://premier.ticketek.com.au" target="_blank">Ticketek</a>.', TRUE, NULL, 'Riverstage, Brisbane City', 'Riverstage, Gardens Point Road, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178315552');
