In 2025, One of One will once again host their annual breakfast event for women, non-binary and GNC people working in Brisbane''s music industry.

This year''s breakfast will bring together the Australian music industry''s leading professionals, and connect them with a group of future leaders including artists, managers, agents, promoters, policy makers, CEOs, general managers, industry organisations, publishers, labels and many distinguished guests.

Taking place at The Triffid in Newstead, the event will feature heartfelt keynote presentations, musical performances, special announcements, and networking opportunities throughout the morning. The event will be fully catered and will include vegan, vegetarian and gluten free options. Find out more on the MoshTix website. 

