INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Harmony Week - Agents of Discovery', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180792081', 'Karawatha Forest Park and Discovery Centre', '2025-03-12T10:00:00+11:00', '2025-03-12T17:00:00+11:00', 'Wednesday, 12 March 2025, 9am - 4pm', 'Celebrate Harmony Week in March with Agents of Discovery. Kids and their carers can play, learn and have fun using the free Agents of Discovery mobile app to complete missions exploring nature at Karawatha Forest.

Agents of Discovery is a great way to get kids active, engaged and exploring the world around them! During environment centre opening hours you can chat to our friendly staff if you need help using the app, and don’t forget to show staff your completed mission to collect a stamp or sticker. Play anytime from 7am to 6pm in the reserve or visit during environment centre opening hours.

To play, adult carers can download the free Agents of Discovery app from Google Play or the Apple store. All children completing missions must be accompanied by a supervising adult.

Requirements: This is a self-guided activity and children must be accompanied and supervised by an adult at all times. Wear sun-safe clothing, sunscreen, and fully enclosed shoes. Bring water and a snack as there are no food outlets on site. Supervising adults please download the Agents of Discovery app and review relevant terms and conditions before your visit.For more information, visit the Agents of Discovery website.', 'Brisbane City Council', 'Family events,Fitness & well-being,Free,Green', 'Harmony Week', 'Fitness & well-being', 'Free', 'https://www.trumba.com/i/DgDBWuOn-mXGPUTC8amfyFrw.jpg', 'Suitable 6-12 years with an accompanying adult.', 'No bookings required, this is a self-guided activity. Adult participants are required to download the free Agents of Discovery app and accompany children.', TRUE, NULL, 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180792081');
