INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Gathering - Robert Ah Wing', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179415832', 'Queen Street Mall, Brisbane City', '2025-03-12T13:00:00+11:00', '2025-03-12T14:00:00+11:00', 'Wednesday, 12 March 2025, 12 - 1pm', 'Gathering presents Robert Ah Wing.

Robert Ah Wing is a passionate advocate for Indigenous languages, dedicated to preserving and revitalising traditional languages and language locations. 

Join us between 12 noon and 1pm at the Queen Street Mall stage for an insightful discussion on language and culture with Robert Ah Wing. 

This Gathering event is produced by Cre8tiveNations.  Gathering showcases Aboriginal and Torres Strait Islander performances in the Queen Street Mall. Unique to Brisbane, it is the only Indigenous performance in Australia that is featured weekly in the heart of a major capital city.', 'Brisbane City Council', 'Aboriginal and Torres Strait Islander,Creative,Culture,Featured,Free,Music,Performing arts', 'Gathering', 'Aboriginal and Torres Strait Islander', 'Free', 'https://www.trumba.com/i/DgDlEsiNONmUfG4Ao3kJyMc5.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, 'Queen Street Mall, Brisbane City', 'Queen Street Mall, Queen Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179415832');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958399', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-03-12T13:00:00+11:00', '2025-03-12T14:00:00+11:00', 'Wednesday, 12 March 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB5UB5rQjgKE8xMwsGuVN8N.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958399');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957717', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-03-12T13:00:00+11:00', '2025-03-12T14:00:00+11:00', 'Wednesday, 12 March 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcsVacu0q9GPQRsMK0ZpaW.jpeg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957717');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Community Immunisation Clinic - Toowong', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942037', 'Toowong Library', '2025-03-12T13:30:00+11:00', '2025-03-12T15:30:00+11:00', 'Wednesday, 12 March 2025, 12:30 - 2:30pm', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgBFx03%2AkclWD-EZofj2uLXQ.jpg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-toowong-2025-tickets-1091861981579" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Toowong Library', 'Toowong Library, Toowong Village Shopping Centre, 9 Sherwood Road, Toowong', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942037');
