Session concludes with a virtual tour of the Brisbane night sky.

Cosmic Collisions was developed by the American Museum of Natural History, New York in collaboration with the Denver Museum of Nature & Science; GOTO INC, Tokyo, Japan; and the Shanghai Science & Technology Museum.
Cosmic Collisions was created by the American Museum of Natural History with the major support and partnership of NASA, Science Mission Directorate, Heliophysics Division.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgDL9DqgqrsviMRiDyucnjQM.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=4744723872492b43416746756d4d3647682b35384867415a4547754e5933364b54723570626276635737773d" target="_blank"><strong>CLICK HERE TO BOOK YOUR TICKETS ONLINE</strong></a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180786365');
