Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projectsThe Moorhen Flats Norman Creek FREECS meet the 1st Sunday of the month 8-11am, as well as every Thursday 8-11am.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgAk7Ew%2AnQtgBGntuyvszFWL.jpg', 'Suitable for adults', 'Bookings required.&nbsp;For more information, or to join a volunteer working bee, contact volunteer group leader Richard on 0429 332 588 or send an email <a href="http://richard.47@icloud.com" target="_blank">richard.47@icloud.com</a>.
&nbsp;', TRUE, 'Young adults,Adults (30+),Seniors', 'Moorhen Flats, Coorparoo', 'Moorhen Flats, 20 Turbo Drive, Coorparoo', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178735809');
