INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179183332', 'Boondall Wetlands Environment Centre', '2025-03-13T11:00:00+11:00', '2025-03-13T11:45:00+11:00', 'Thursday, 13 March 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day of the event Arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play. Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgDAFh6EOoWRxGrN9vGrO3kI.jpg', 'Ages 3 - 5', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1096879769919" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, 'Preschool kids', 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179183332');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Nature Journaling for Adults', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179885514', 'Karawatha Forest Park and Discovery Centre', '2025-03-13T11:00:00+11:00', '2025-03-13T13:00:00+11:00', 'Thursday, 13 March 2025, 10am - 12pm', 'Nature journaling is the practice of recording your interactions with nature using sketches, writing, paintings, poetry, species lists, numbers, graphs, cartoons and more. Environment centre staff will guide you through some fun, simple exercises at this introductory session. 

All materials provided, but we recommend you bring your own basic sketch/art book so you can keep your creations in one place. Limited seating available. Please bring an outdoor chair if you need one.

Requirements: For adults aged 18 years and over. Please arrive 10 minutes early to check in with staff at the environment centre. Wear sun-safe clothing, sunscreen, fully enclosed shoes, and bring insect repellent. Materials provided but we recommend bringing your own sketch/art book or pad. Limited seating available. Please bring an outdoor chair if you need one. Bring water and a snack as there are no food outlets on site.Note: This activity will go ahead in light rain and can be delivered indoors if required. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Art,Creative,Free,Green,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgDKnxfhRoEzpo4JLXI0zzX9.jpg', '18+', 'Bookings required via <a href="https://www.eventbrite.com.au/e/nature-journaling-for-adults-tickets-1200582086339?aff=oddtdtcreator" target="_blank">Eventbrite</a>.

All participants must have a ticket.&nbsp;If you no longer can attend, please cancel your ticket via Eventbrite.
&nbsp;', TRUE, 'Young adults,Adults (30+),Seniors', 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179885514');
