INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Talk to a Planner', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180079302', 'Garden City Library', '2025-03-13T17:00:00+11:00', '2025-03-13T20:00:00+11:00', 'Thursday, 13 March 2025, 4 - 7pm', 'Talk to a Planner sessions help residents, business owners, community groups and industry professionals understand Brisbane City Plan 2014 (City Plan) and how it relates to their building and construction plans.

Talk to a Planner is available all year round, with additional sessions held regularly across the city for your convenience.

During these free sessions you can speak face-to-face with a planning specialist, giving you the opportunity to ask any questions you may have about how City Plan relates to your property.

Council also has a team of dedicated officers who can answer simple questions about your development application over the phone during business hours (9am-4pm, Monday-Friday). To speak to an officer please phone Council on 07 3403 8888 and ask to speak with a Planning Information Officer.', 'Brisbane City Council', 'Free,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgDDj7Yfnr2DtZoLUimpd70i.jpeg', 'Open', 'Sessions are by appointment only. Book your 15 minute appointment via <a href="https://www.eventbrite.com.au/e/talk-to-a-planner-garden-city-library-13-march-2025-tickets-1216063431459" target="_blank">Eventbrite</a>.&nbsp;', TRUE, NULL, 'Garden City Library', 'Garden City Library, Westfield Mt Gravatt, Level R4, corner of Logan Road and Kessels Road, Upper Mount Gravatt', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180079302');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, waterwayaccessfacilities, waterwayaccessinformation, status, libraryeventtypes, eventtype, communityhall, locationifvenueunavailable, image, externaleventid) VALUES ('Community Immunisation Clinic - Carindale (evening)', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942095', 'Carindale Library', '2025-03-13T17:00:00+11:00', '2025-03-13T18:45:00+11:00', 'Thursday, 13 March 2025, 4 - 5:45pm', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgCpPZ9hIKB83A4ZbvDlsxxb.jpg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-carindale-evening-2025-tickets-1097724516579" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Carindale Library', 'Carindale Library, Westfield Carindale, 1151 Creek Road (near Millennium Boulevard), Carindale', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942095');
